C.rs=new P.aA("\u041a\u041b\u0418\u041d\u0418\u041d\u0413","\u041a\u043e\u043c\u043f\u0430\u043d\u0438\u044f \u0410\u041d\u0410\u041a\u041e\u041d \u043e\u0441\u0443\u0449\u0435\u0441\u0442\u0432\u043b\u044f\u0435\u0442 \u0435\u0436\u0435\u0434\u043d\u0435\u0432\u043d\u0443\u044e \u043a\u043e\u043c\u043f\u043b\u0435\u043a\u0441\u043d\u0443\u044e, \u043f\u043e\u0434\u0434\u0435\u0440\u0436\u0438\u0432\u0430\u044e\u0449\u0443\u044e \u0438 \u0433\u0435\u043d\u0435\u0440\u0430\u043b\u044c\u043d\u0443\u044e \u0443\u0431\u043e\u0440\u043a\u0443 \u043b\u044e\u0431\u044b\u0445 \u043f\u043e\u043c\u0435\u0449\u0435\u043d\u0438\u0439. \u041c\u044b \u043f\u0440\u043e\u0432\u043e\u0434\u0438\u043c \u0441\u0443\u0445\u0443\u044e, \u0432\u043b\u0430\u0436\u043d\u0443\u044e, \u0438\u043d\u0442\u0435\u043d\u0441\u0438\u0432\u043d\u0443\u044e \u0443\u0431\u043e\u0440\u043a\u0443, \u0432 \u0441\u043e\u043e\u0442\u0432\u0435\u0442\u0441\u0442\u0432\u0438\u0438 \u0441 \u043e\u043f\u0440\u0435\u0434\u0435\u043b\u0435\u043d\u043d\u044b\u043c \u0440\u0435\u0436\u0438\u043c\u043e\u043c \u0438 \u0442\u0440\u0435\u0431\u043e\u0432\u0430\u043d\u0438\u044f\u043c\u0438 \u0437\u0430\u043a\u0430\u0437\u0447\u0438\u043a\u0430. \u0410\u0431\u0441\u043e\u043b\u044e\u0442\u043d\u044b\u0439 \u043f\u0440\u043e\u0444\u0435\u0441\u0441\u0438\u043e\u043d\u0430\u043b\u0438\u0437\u043c \u0441\u043e\u0442\u0440\u0443\u0434\u043d\u0438\u043a\u043e\u0432 \u0438 \u043d\u0430\u043b\u0438\u0447\u0438\u0435 \u043b\u0443\u0447\u0448\u0435\u0433\u043e \u0442\u0435\u0445\u043d\u0438\u0447\u0435\u0441\u043a\u043e\u0433\u043e \u043e\u0441\u043d\u0430\u0449\u0435\u043d\u0438\u044f \u043f\u043e\u043c\u043e\u0433\u0430\u044e\u0442 \u043e\u0431\u0435\u0441\u043f\u0435\u0447\u0438\u0432\u0430\u0442\u044c \u0447\u0438\u0441\u0442\u043e\u0442\u0443 \u043d\u0430 \u0441\u0430\u043c\u043e\u043c \u0432\u044b\u0441\u043e\u043a\u043e\u043c \u0443\u0440\u043e\u0432\u043d\u0435. \u0412\u044b \u044d\u043a\u043e\u043d\u043e\u043c\u0438\u0442\u0435 \u0432\u0440\u0435\u043c\u044f \u043d\u0430 \u043f\u043e\u0438\u0441\u043a \u0441\u043e\u0442\u0440\u0443\u0434\u043d\u0438\u043a\u043e\u0432, \u0437\u0430\u043a\u0443\u043f\u043a\u0443 \u043c\u0430\u0442\u0435\u0440\u0438\u0430\u043b\u043e\u0432, \u0438\u043d\u0432\u0435\u043d\u0442\u0430\u0440\u044f, \u0434\u043e\u0440\u043e\u0433\u043e\u0441\u0442\u043e\u044f\u0449\u0435\u0439 \u0442\u0435\u0445\u043d\u0438\u043a\u0438, \u043e\u043f\u0442\u0438\u043c\u0438\u0437\u0438\u0440\u0443\u0435\u0442\u0435 \u0440\u0430\u0441\u0445\u043e\u0434\u044b, \u0438 \u043f\u043e\u043b\u0443\u0447\u0430\u0435\u0442\u0435 \u0433\u0430\u0440\u0430\u043d\u0442\u0438\u0440\u043e\u0432\u0430\u043d\u043d\u0443\u044e \u0447\u0438\u0441\u0442\u043e\u0442\u0443 \u043a\u0430\u0436\u0434\u044b\u0439 \u0434\u0435\u043d\u044c.\n\u041a\u043e\u043c\u043f\u0430\u043d\u0438\u044f \u0410\u041d\u0410\u041a\u041e\u041d \u043f\u0440\u0435\u0434\u043e\u0441\u0442\u0430\u0432\u043b\u044f\u0435\u0442 \u0432\u044b\u0441\u043e\u043a\u043e\u043a\u0430\u0447\u0435\u0441\u0442\u0432\u0435\u043d\u043d\u044b\u0435 \u0443\u0441\u043b\u0443\u0433\u0438, \u0442\u0430\u043a\u0438\u0435 \u043a\u0430\u043a: \u043f\u0440\u043e\u0444\u0435\u0441\u0441\u0438\u043e\u043d\u0430\u043b\u044c\u043d\u0430\u044f \u043c\u043e\u0439\u043a\u0430 \u0441\u0442\u0435\u043a\u043b\u044f\u043d\u043d\u044b\u0445 \u0444\u0430\u0441\u0430\u0434\u043e\u0432 \u0432 \u043e\u0444\u0438\u0441\u0430\u0445,  \u043c\u043e\u0439\u043a\u0430 \u043e\u043a\u043e\u043d \u043b\u044e\u0431\u044b\u0445 \u043f\u043e\u043c\u0435\u0449\u0435\u043d\u0438\u0439. \u0427\u0438\u0441\u0442\u044b\u0439 \u0444\u0430\u0441\u0430\u0434 \u0438 \u043e\u043a\u043d\u0430  \u043d\u0430\u0434\u043e\u043b\u0433\u043e \u0441\u043e\u0445\u0440\u0430\u043d\u044f\u0442 \u0430\u043a\u043a\u0443\u0440\u0430\u0442\u043d\u044b\u0439 \u0438 \u044d\u0441\u0442\u0435\u0442\u0438\u0447\u043d\u044b\u0439 \u0432\u043d\u0435\u0448\u043d\u0438\u0439 \u0432\u0438\u0434 \u0437\u0434\u0430\u043d\u0438\u044f, \u0441\u043e\u0437\u0434\u0430\u0432\u0430\u044f \u043d\u0443\u0436\u043d\u043e\u0435 \u043d\u0430\u0441\u0442\u0440\u043e\u0435\u043d\u0438\u0435 \u0438 \u0441\u043e\u043e\u0442\u0432\u0435\u0442\u0441\u0442\u0432\u0443\u044f \u0432\u0430\u0448\u0435\u043c\u0443 \u0441\u0442\u0430\u0442\u0443\u0441\u0443.",t.J)
C.rv=new P.aA("\u0411\u0423\u0425\u0413\u0410\u041b\u0422\u0415\u0420\u0421\u041a\u0418\u0415 \u0423\u0421\u041b\u0423\u0413\u0418","\u0412\u044b \u0437\u0430\u043d\u0438\u043c\u0430\u0435\u0442\u0435\u0441\u044c \u0441\u0432\u043e\u0438\u043c \u0431\u0438\u0437\u043d\u0435\u0441\u043e\u043c, \u043c\u044b \u0437\u0430\u043d\u0438\u043c\u0430\u0435\u043c\u0441\u044f \u0432\u0430\u0448\u0435\u0439 \u0431\u0443\u0445\u0433\u0430\u043b\u0442\u0435\u0440\u0438\u0435\u0439. \u041a\u043e\u043c\u043f\u0430\u043d\u0438\u044f \u0410\u041d\u0410\u041a\u041e\u041d  \u043f\u0440\u0435\u0434\u043e\u0441\u0442\u0430\u0432\u043b\u044f\u0435\u0442 \u0443\u0441\u043b\u0443\u0433\u0438 \u043f\u043e \u0432\u0435\u0434\u0435\u043d\u0438\u044e \u0431\u0443\u0445\u0433\u0430\u043b\u0442\u0435\u0440\u0441\u043a\u043e\u0433\u043e \u0443\u0447\u0435\u0442\u0430 \u0412\u0430\u0448\u0435\u0433\u043e \u043e\u0431\u044a\u0435\u043a\u0442\u0430 \u043d\u0435\u0434\u0432\u0438\u0436\u0438\u043c\u043e\u0441\u0442\u0438. \u041f\u0440\u0435\u0434\u043e\u0441\u0442\u0430\u0432\u043b\u044f\u0435\u043c \u043a\u0430\u043a \u043a\u043e\u043c\u043f\u043b\u0435\u043a\u0441\u043d\u043e\u0435 \u043e\u0431\u0441\u043b\u0443\u0436\u0438\u0432\u0430\u043d\u0438\u0435, \u0442\u0430\u043a \u0438 \u0440\u0430\u0437\u043e\u0432\u044b\u0435 \u0443\u0441\u043b\u0443\u0433\u0438. \u0420\u0430\u0431\u043e\u0442\u0430\u044f \u0441 \u043d\u0430\u043c\u0438, \u0432\u044b \u043f\u043e\u043b\u0443\u0447\u0430\u0435\u0442\u0435 \u0433\u0440\u0430\u043c\u043e\u0442\u043d\u044b\u0435 \u043a\u043e\u043d\u0441\u0443\u043b\u044c\u0442\u0430\u0446\u0438\u0438 \u043f\u043e \u0432\u043e\u043f\u0440\u043e\u0441\u0430\u043c \u0431\u0443\u0445\u0433\u0430\u043b\u0442\u0435\u0440\u0441\u043a\u043e\u0433\u043e \u0438 \u043d\u0430\u043b\u043e\u0433\u043e\u0432\u043e\u0433\u043e \u0443\u0447\u0435\u0442\u0430, \u0432\u0435\u0434\u0435\u043d\u0438\u0435 \u0431\u0430\u0437\u044b \u0432 \u0441\u0438\u0441\u0442\u0435\u043c\u0435 1\u0421: \u0411\u0443\u0445\u0433\u0430\u043b\u0442\u0435\u0440\u0438\u044f \u0438\u043b\u0438 \u0432\u0435\u0434\u0435\u043d\u0438\u0435 \u0443\u0447\u0435\u0442\u0430 \u0432 \u0432\u0430\u0448\u0435\u0439 \u0431\u0430\u0437\u0435 \u043d\u0430 \u0443\u0441\u043b\u043e\u0432\u0438\u044f\u0445 \u0443\u0434\u0430\u043b\u0435\u043d\u043d\u043e\u0433\u043e \u0434\u043e\u0441\u0442\u0443\u043f\u0430, \u043e\u043f\u0435\u0440\u0430\u0442\u0438\u0432\u043d\u043e\u0435 \u0440\u0435\u0430\u0433\u0438\u0440\u043e\u0432\u0430\u043d\u0438\u0435 \u043d\u0430 \u0437\u0430\u043f\u0440\u043e\u0441\u044b \u0438 \u0442\u0440\u0435\u0431\u043e\u0432\u0430\u043d\u0438\u044f \u043d\u0430\u043b\u043e\u0433\u043e\u0432\u043e\u0439 \u0438\u043d\u0441\u043f\u0435\u043a\u0446\u0438\u0438 \u0438 \u0444\u043e\u043d\u0434\u043e\u0432.",t.J)
